// Tickets.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Ticket.css'; // Optional: Create CSS for styling

const movies = [
  { id: 1, title: 'Avatar', description: 'Sci-fi epic', rating: '4.7', price: 400, image: 'path/to/avatar.jpg', theatre: 'K' },
  { id: 2, title: 'Inception', description: 'Mind-bending thriller', rating: '4.8', price: 350, image: 'path/to/inception.jpg', theatre: 'Theatre 2' },
  { id: 3, title: 'Interstellar', description: 'Space exploration adventure', rating: '4.9', price: 420, image: 'path/to/interstellar.jpg', theatre: 'Theatre 3' },
  { id: 4, title: 'The Dark Knight', description: 'Superhero drama', rating: '4.9', price: 380, image: 'path/to/darkknight.jpg', theatre: 'Theatre 4' },
  { id: 5, title: 'Jurassic Park', description: 'Dinosaur adventure', rating: '4.6', price: 360, image: 'path/to/jurassicpark.jpg', theatre: 'Theatre 5' },
];

const sports = [
  { id: 1, title: 'India vs Pakistan Football', description: 'Intense football match between India and Pakistan', rating: '4.9', price: 600, stadium: 'Stadium A', isIndian: true },
  { id: 2, title: 'India vs Australia Cricket', description: 'Thrilling cricket match between India and Australia', rating: '4.8', price: 650, stadium: 'Stadium B', isIndian: true },
  { id: 3, title: 'India vs USA Basketball', description: 'High-energy basketball game between India and USA', rating: '4.6', price: 550, stadium: 'Stadium C', isIndian: true },
  { id: 4, title: 'India vs England Tennis', description: 'Competitive tennis match between India and England', rating: '4.7', price: 500, stadium: 'Stadium D', isIndian: true },
  { id: 5, title: 'India vs Canada Hockey', description: 'Fast-paced hockey match between India and Canada', rating: '4.8', price: 520, stadium: 'Stadium E', isIndian: true },
];

function Tickets() {
  const [cart, setCart] = useState([]);
  const navigate = useNavigate();

  const addToCart = (item) => {
    setCart([...cart, item]);
    alert(`${item.title} added to cart`);
    navigate('/cart', { state: { cart: [...cart, item] } });
  };

  return (
    <div className="tickets-page">
      <h1>Tickets Page</h1>
      
      <div className="tickets-section">
        <h2>Movies</h2>
        <div className="tickets-list">
          {movies.map(movie => (
            <div key={movie.id} className="ticket-item">
              <h3>{movie.title}</h3>
              <h4>{movie.tamilTitle}</h4>
              <img src={movie.image} alt={movie.title} className="movie-image" />
              <p>{movie.description}</p>
              <p>Rating: {movie.rating}</p>
              <p>Price: ₹{movie.price}</p>
              <p>Theatre: {movie.theatre}</p>
              <button onClick={() => addToCart(movie)}>Add to Cart</button>
            </div>
          ))}
        </div>

        <h2>Sports</h2>
        <div className="tickets-list">
          {sports.map(event => (
            <div key={event.id} className="ticket-item">
              <h3>{event.title}</h3>
              <p>{event.description}</p>
              <p>Rating: {event.rating}</p>
              <p>Price: ₹{event.price}</p>
              <p>Stadium: {event.stadium}</p>
              <p>Sport: {event.isIndian ? 'Indian Sport' : 'International Sport'}</p>
              <button onClick={() => addToCart(event)}>Add to Cart</button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Tickets;
